import "./QuestionAnswer.css";
import { useState } from "react";

function QuestionAnswer(props) {
  const [style, setStyle] = useState("faq-question");
  // let style = "faq-question";

  const questionOpener = function (e) {
    if (style === "faq-question") {
      setStyle("faq-question open-faq-question");
    } else if (style === "faq-question open-faq-question") {
      setStyle("faq-question");
    }
  };

  return (
    <div>
      <div className="faq-question-container">
        <div className={style} onClick={questionOpener}>
          {props.faqTunnel.question}
        </div>
        <svg
          xmlns="http://www.w3.org/2000/svg"
          fill="none"
          viewBox="0 0 24 24"
          stroke-width="1.5"
          stroke="currentColor"
          className="faq-icon"
        >
          <path
            stroke-linecap="round"
            stroke-linejoin="round"
            d="M19.5 8.25l-7.5 7.5-7.5-7.5"
          />
        </svg>
      </div>
      <div className="faq-answer">{props.faqTunnel.answer}</div>
    </div>
  );
}

export default QuestionAnswer;
